import React from "react";
import '@fortawesome/free-regular-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBriefcase } from '@fortawesome/free-solid-svg-icons';
import { VerticalTimeline, VerticalTimelineElement }  from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';
import '../assets/styles/Timeline.scss'

function Timeline() {
  return (
    <div id="history">
      <div className="items-container">
        <h1>Career History</h1>
        <VerticalTimeline>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            contentStyle={{ background: 'white', color: 'rgb(39, 40, 34)' }}
            contentArrowStyle={{ borderRight: '7px solid  white' }}
            date="2022 - present"
            iconStyle={{ background: '#5000ca', color: 'rgb(39, 40, 34)' }}
            icon={<FontAwesomeIcon icon={faBriefcase} />}
          >
            <h3 className="vertical-timeline-element-title">Freelance Designer / Devloper</h3>
            <h4 className="vertical-timeline-element-subtitle">Mercury Studio</h4>
            <p>
              Full-stack Web Development, GenAI/LLM, Project Management, Business Development
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            date="2020 - 2022"
            iconStyle={{ background: '#5000ca', color: 'rgb(39, 40, 34)' }}
            icon={<FontAwesomeIcon icon={faBriefcase} />}
          >
            <h3 className="vertical-timeline-element-title">UI/UX Designer</h3>
            <h4 className="vertical-timeline-element-subtitle">The Youth Herald, Ottawa</h4>
            <p>
            Modernized landing pages, increasing user engagement by 37%. Collaborated with cross-functional teams to create design solutions aligned with business goals. Conducted user research and usability testing to improve user experience.
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            date="2021 - 2021"
            iconStyle={{ background: '#5000ca', color: 'rgb(39, 40, 34)' }}
            icon={<FontAwesomeIcon icon={faBriefcase} />}
          >
            <h3 className="vertical-timeline-element-title">Interactive Media Design</h3>
            <h4 className="vertical-timeline-element-subtitle">Algonquin College, Ottawa, ON</h4>
            <p>
            I gained expertise in web design, UX/UI, video production, and motion graphics, mastering tools like Adobe Creative Suite, HTML/CSS, and JavaScript. Through hands-on projects and team collaborations, I developed the skills to create engaging digital experiences and user-centric designs.
            </p>
          </VerticalTimelineElement>
          <VerticalTimelineElement
            className="vertical-timeline-element--work"
            date="2020 - 2020"
            iconStyle={{ background: '#5000ca', color: 'rgb(39, 40, 34)' }}
            icon={<FontAwesomeIcon icon={faBriefcase} />}
          >
            <h3 className="vertical-timeline-element-title">Design Intern</h3>
            <h4 className="vertical-timeline-element-subtitle">Honeycomb, Mumbai</h4>
            <p>
            Assisted in user research, wireframing, and prototyping for a restaurant website. Developed engaging content and intuitive user interfaces to enhance brand communication.
            </p>
          </VerticalTimelineElement>
        </VerticalTimeline>
      </div>
    </div>
  );
}

export default Timeline;
